INSERT INTO `courses` (`id`, `name`, `description`, `date_from`, `date_to`, `duration`, `time`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Technical Administration', 'The course offers comprehensive theory and hands-on guidance to the Technical professionals on the usage of Altitude uCI Application to support the Contact Center operations.', '2015-11-01', '2015-11-05', 5, '09:00-15:00', 1, '2015-10-06 12:09:36', '0000-00-00 00:00:00'),
(5, 'Script Development', 'The course is specifically designed to unleash the power of Altitude Scripting Language with the advanced integrated development environment provided by Altitude Script Developer.', '2015-11-08', '2015-11-12', 5, '09:00-17:00', 1, '2015-10-06 13:07:55', '0000-00-00 00:00:00'),
(6, 'Inbound Floor Operations', 'The course offers comprehensive knowledge of Altitude uCI built-in dynamic features used to manage and monitor multi-channel Inbound contact center.', '2015-12-08', '2015-12-10', 3, '09:00-17:00', 1, '2015-10-06 13:13:22', '2015-10-07 10:38:59'),
(8, 'Outbound Floor Operations', 'This exclusive course focuses on the Altitude uCI features for Outbound Contact Center and delivers hands-on guidance on performance metrics, contact data management, Outbound dialers and much more.', '2015-12-15', '2015-12-17', 3, '09:00-17:00', 1, '2015-10-07 06:56:55', '2015-10-07 09:11:46');
