(66, 2, 29, 'nWyZyjaz', 'Hi Guys,\r\n\r\n- PROJECT REMINDER -\r\nI just want to remind you all about your projects. Here''s all the info.\r\n\r\nDeadline: March 20, 2015 before 12midnight\r\nSend it to my email having this format:\r\nSubject: ADVPROG102 FINAL PROJECT\r\nMessage:\r\nGroup Members: \r\nLASTNAME, FIRSTNAME M.I.\r\nLASTNAME, FIRSTNAME M.I.\r\nLASTNAME, FIRSTNAME M.I.\r\nLASTNAME, FIRSTNAME M.I.\r\nLASTNAME, FIRSTNAME M.I.\r\n\r\nAttachment: I only need the .c file, NOT the .exe file\r\n\r\nI want to see to the code a comment having the contribution of Mr or Ms. Doe for example. Don''t worry for me to check if you really contribute I will ask one of your group member if you really do your part, if not then no more explanation you will get ZERO score for this project over 100.\r\n\r\nIf you have any clarification just feel free to comment just make sure it is course related. Also be ready for your departmental exam in ADVPROG I will be the one to create the final exam. Prepare for some basic coding applying those topics that we tackled.\r\n\r\nThanks!', '2015-03-17 12:34:55', '0000-00-00 00:00:00'),
(67, 2, 29, 'nWyZyjaz', 'Additional Lecture\r\n\r\nThis will be included on your departmental final exam. I am the one who created your departmental exam and some materials are given by Sir Sabado and Sir Claud. Be prepared always and take it as advantage that I am the one who created the exam.\r\n\r\nAlso, study all your exercises during the lab. I might include that to your exam.\r\n\r\nExam Type:\r\nMultiple Choice\r\nIdentification\r\nProgram Tracing\r\nCoding', '2015-03-17 15:20:54', '0000-00-00 00:00:00'),
